import React from "react";
import {Card, Button,Container, Navbar, Nav, } from "react-bootstrap";

import "bootstrap/dist/css/bootstrap.css";

function unidetailsComponent(){

    return(
        <Container>
        <Navbar bg="light" expand="lg">

  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#home"><Button>ADD</Button></Nav.Link>
      <Nav.Link href="#home"><Button>VIEW</Button></Nav.Link>

    </Nav>

    <Nav>
    <Nav.Link href="/"><Button>LOGOUT</Button></Nav.Link>

    </Nav>

  </Navbar.Collapse>
  </Navbar>
  <Card>
  <Card.Body>Hello {localStorage.getItem('uid')}</Card.Body>
</Card>
      </Container>
    );


}
export default unidetailsComponent;
